import React,{Component} from 'react'

class Signin extends Component {
constructor(props)
{
	super(props);
	this.state = {
					address:"",
					status:"",
					account:"",
					error:false
		         };
}
makeApiCall(){
	const { onRouteChange } = this.props;
	const email=document.getElementById("email-address")
	const api_call = fetch(`https://api.zerobounce.net/v2/validate?api_key=a98a84c79430483c99b7e7576d82d2e6&email=${email}`);
    const response = api_call.json();
    this.setState({
    	address:response.address,
    	status:response.status,
    	account:response.account,
    	error:false
    });
    console.log(response);
    if(response.status===valid)
    {
       ()=>onRouteChange('Weather')
    }
    else{
    	alert("Invalid user")
    }
 }

 onEmailchange(event){
  	this.setState({email:event.target.value});
 }
render() {
	return(
		<article className="br2 ba dark-gray b--black-10 mv4 w-100 w-50-m w-25-l mw5 center">
		<main className="pa4 black-80">
		  <form className="measure">
		    <fieldset id="sign_up" className="ba b--transparent ph0 mh0">
	      	<legend className="f4 fw6 ph0 mh0">Sign In</legend>
		    <div className="mt3">
		       <label className="db fw6 lh-copy f6" fo="email-address">Email</label>
		        <input 
		           className="pa2 input-reset ba bg-transparent hover-black w-100" 
		           type="text" name="email-address"
		           id="email-address"
		           onChange={this.onEmailchange}
		         />
		      </div>
		      <div className="mv3">
		        <label className="db fw6 lh-copy f6" fo="password">Password</label>
		        <input
		             className="b pa2 input-reset ba bg-transparent hover-black w-100" 
		             type="password" 
		             name="password"  
		             id="password" 
		         />
		      </div>
		    </fieldset>
		    <div className="">
		        <input className="b ph3 pv2 input-reset ba b--black bg-transparent grow pointer f6 dib" 
		               type="submit" 
		               value="Sign in"
		               onClick={this.makeApiCall}
		         />
		    </div>
		    <div className="lh-copy mt3">
	      <a href="#0" className="f6 link dim black db">Sign up</a>
	    </div>
	  </form>
	</main>
	</article>
  )
}
}
export default Signin;
